import React from 'react';

function Home() {
    return (
        <>
         <section id='header' className=''>
           <div className='container-fluid nav-bg'>
            <div className='row'>
                <div className='col-10 mx-auto'>
                    <div className='col-md-6 pt-5 pt-lg-0 order-lg-1'>
                        {'I am web developer'}
                        <h1>Grow your services with <strong>Binod </strong> <br />
                        {'if you want to work with me plz. contact me.'} </h1>
                        <h2 className='my-3'>
                            I am full stack web developer
                        </h2>
                        <div className='mt-3'>
                            <a href='j' className='btn-get-started'>Get Started </a>

                        </div>
                    </div>

                </div>

            </div>

          </div>
         </section>



        </>
    );

};

export default Home;
